import React from "react";
import "../styles/index.css";

export default class SustainButton extends React.Component {
  render() {
    return (
      <button
        className="hover-shadow inl-block"
        style={{
          borderRadius: "100%",
          border: "2px solid",
          borderColor: "red",

          backgroundColor: "transparent",
          width: "2rem",
          height: "2rem",
          position: "absolute",
          outline: "none",
          pointerEvents: "none"
        }}
      >
        {this.props.text}
      </button>
    );
  }
}
